  false,\n\t\"url\": null,\n\t\"notes\": \"Ecosystem & Fisheries-Oceanography Coordinated
  Investigations (Eco-FOCI) is an effort by National Oceanic and Atmospheric Administration
  (NOAA) and associated academic scientists. Eco-FOCI's goal is to understand the
  effects of abiotic and biotic variability on ecosystems of the North Pacific Research
  Board (NPRB), the Alaska Ocean Observing System (AOOS), and PMEL/AFSC base. This
  was the last of a series of cruises in support of research of the Bering Ecosystem
  Study (BEST) and Bering Sea Integrated Ecosystem Study (BSIERP) co-sponsored by
  the National Science Foundation and the North Pacific Research Board.\",\n\t\"owner_org\":
